 Gast, die uns voller Begeisterung von ihrem Academic Gap Year am Santa Barbara City College (@sbccinternational) berichtet.\u2060\n\u2060\nBesonders angetan haben es Luzie der traumhaft gelegene Campus direkt am Meer \ud83c\udf34, die engagierten Dozent*innen und nat\u00fcrlich die einmalige M\u00f6glichkeit, ihre Sprachkenntnisse zu verbessern und ihren Traum vom Jurastudium zu festigen. On top konnte sie viele neue Kontakte kn\u00fcpfen und hat nun ein internationales Netzwerk \u00fcber die ganze Welt verstreut. \ud83d\ude80\u2060\n\u2060\nDu m\u00f6chtest mehr erfahren? Dann h\u00f6re am besten gleich in die neue Folge rein und hole dir hilfreiche Tipps f\u00fcr die Planung und Organisation deines Academic Gap Years.\u2060\n\u2060\nDer Link in unserer \ud83d\udc49\ufe0f Bio f\u00fchrt dich dorthin.\u2060\n\u2060\n#podcast #usa #santabarbara #kalifornien #california #internationalstudent #studierenindenusa #studyintheus #nachdemabi #gapyear #goexplore #traveltheworld #tapetenwechsel #fernweh #campus #sonne #palmen #auslandsstudium #studyabroad #campusreporter \u2060\n#BesteZeitAuslandsstudium #college_contact"}}]},"shortcode":"CfwP61YM02T","edge_media_to_comment":{"count":0},"taken_at_timestamp":1657288920,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292385048_1392257971293020_1614520186007196389_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=aE78N6eVWQQAX-MQxyF\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_vQU2q-SU8im8fX_1U_FgoJCxV6C9_jEs1yZPxuGxYzg\u0026oe=62D16F5A\u0026_nc_sid=4efc9f","edge_liked_by":{"count":10},"edge_media_preview_like":{"count":10},"owner":{"id":"2218670379"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/292385048_1392257971293020_1614520186007196389_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=aE78N6eVWQQAX-MQxyF\u0026edm=