o_caption":{"edges":[{"node":{"text":"Sony Music Group Global Scholarship Program Launched\n\nApplication Deadline: July 25, 2022\n\nIIE is pleased to partner with Sony Music Group (SMG) to administer the Sony Music Group Global Scholars Program, a new initiative designed to provide scholarships for students enrolled in a wide range of leading music and music business-related fields of study at accredited colleges and universities around the world. SMG\u2019s goal is to alleviate the financial burden for up to 50 students from diverse backgrounds; students will receive annual financial support ranging between USD3,000 and USD20,000 for up to the period of the degree program or upon completion, whichever is sooner, depending on financial need and region. \n\nEligible applicants can visit the program website https://www.iie.org/sonymusic to learn more and contact sonymusic@iie.org with any questions.\n\n#Scholarships #MusicScholarship #StudyMusic #SonyMusic #StudyWithUS #StudyInTheUS #EstudiaEnLosEEUU #EducationUSA #EducationUSAChile #MetasEducativas"}}]},"shortcode":"Cfn4xOiO8PQ","edge_media_to_comment":{"count":0},"taken_at_timestamp":1657008307,"dimensions":{"height":571,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291964797_752175182767362_7106388191061727499_n.jpg?stp=dst-jpg_e15_fr_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=9DvSqRWXcN8AX-RIR-g\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_VssZX7k_mGE6I2qGOlemgg6iC642H-I59tXeSb9SFJw\u0026oe=62D1C7DC\u0026_nc_sid=4efc9f","edge_liked_by":{"count":2},"edge_media_preview_like":{"count":2},"owner":{"id":"46884369994"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291964797_752175182767362_7106388191061727499_n.jpg?stp=c254.0.571.571a_dst-jpg_e15\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=9DvSqRWXcN8AX-RIR-g\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8yjhTbR4ayYkQn7_-5iVfcWniY8