 Auslandserfahrungen sammeln k\u00f6nnen. Genau das verspricht ein Academic Gap Year im Ausland! \ud83d\udcaf\u2060\n\u2060\nDu m\u00f6chtest mehr zu diesem Programm erfahren? Dann sei gespannt auf unsere neue \ud83c\udfa7\ufe0f Podcastfolge von #BesteZeit, denn dieses Mal dreht sich alles rund um ein solches Schnupperstudium nach dem Abi: Welche M\u00f6glichkeiten bietet dir dieses Programm? Welche \ud83c\udf93\ufe0f Hochschulen stehen zur Auswahl? Und was gilt es hinsichtlich der Kurswahl und Unterkunftssuche zu beachten?\u2060\n\u2060\nZu Gast haben wir in dieser Episode unsere ehemalige Campusreporterin Luzie (@lxzie_81701), die uns ausf\u00fchrlich von ihrem Academic Gap Year am Santa Barbara City College (@sbccinternational) berichtet und dabei jede Menge praktische Insider-Tipps parat hat. \ud83e\udd73\u2060\n\u2060\nNeugierig? Stay tuned - die neue Folge geht bald online! \ud83d\ude0e\u2060\n\u2060\nAlle bisherigen Episoden von #BesteZeit findest du \u00fcber den \ud83d\udc49\ufe0f Link in unserer Bio.\u2060\n\u2060\n#podcast #usa #santabarbara #kalifornien #california #internationalstudent #studierenindenusa #studyintheus #nachdemabi #gapyear #goexplore #traveltheworld #tapetenwechsel #fernweh #campus #sonne #palmen #auslandsstudium #studyabroad #campusreporter \u2060\n#BesteZeitAuslandsstudium #college_contact\u2060"}}]},"shortcode":"CfeOZEMsjld","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656684154,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291339132_1080000012936783_6951305671619005329_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=oIt_nPYr6yQAX-UHj0m\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-Cvty2GP7XvvHpDNWOfCRHqWydZcf51T6_xhlvevdAsQ\u0026oe=62D000D1\u0026_nc_sid=4efc9f","edge_liked_by":{"count":9},"edge_media_preview_like":{"count":9},"owner":{"id":"2218670379"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.n