 jogo on-line Fortnite!\n\nO que era s\u00f3 um hobbie para o jovem de 20 anos, se tornou o passaporte para a realiza\u00e7\u00e3o do seu maior sonho, que \u00e9 morar nos EUA. O atleta de e-sports, que tamb\u00e9m teve que apresentar boas notas no Ensino M\u00e9dio e passar por alguns testes, optou pela @ok_christian, onde recebeu bolsa de estudos de 75% no curso de ci\u00eancia da computa\u00e7\u00e3o. \n\nParab\u00e9ns pela conquista, Matheus! Voe longe! \n\nFonte: @portalg1 \n\n#OkChristian #OklahomaCity #OklahomaChristianUniversity #Scholarship #BolsaDeEstudos #StudyUSA #Interc\u00e2mbio #StudyInTheUS #eSports #Fortnite #JogosOnline #UniversidadesAmericanas"}}]},"shortcode":"CfcBhhJMu8h","edge_media_to_comment":{"count":56},"taken_at_timestamp":1656610244,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291593438_1095965271269516_8252700121515860089_n.jpg?stp=dst-jpg_e15_fr_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=_J6II-qe0vwAX_3k1zf\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_jm4dCkref_xkV7NnuB1AkabqYIT10tYO4LTH6wnCJXA\u0026oe=62D1AB22\u0026_nc_sid=4efc9f","edge_liked_by":{"count":1622},"edge_media_preview_like":{"count":1622},"owner":{"id":"934020000"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291593438_1095965271269516_8252700121515860089_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=_J6II-qe0vwAX_3k1zf\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-Nu4qWHGE61mot1OiPOGRjQ0TjxpFr2dLYCIjYYyuXLw\u0026oe=62D1AB22\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291593438_1095965271269516_8252700121515860089_n.jpg?stp=dst-jpg_e15_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=_J6II-qe0vwAX_3k1zf\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8cFSG7Lsh9FKagfuAOhmix5Qc