eks already. I will be studying here the presence of microplastics in the natural environment, especially in snow in the high mountains (Sierra Nevada). So, a continuation of the research that I started with my master's thesis in Poland. I am doing my PhD for the Desert Resarch Institute and the University of Nevada in Reno.\n\nSome nice things, to Yosemite I have 3.5 hours drive, to Lake Tahoe, where one can find great climbing and skiing is just an hour :).\n\nReno is located in the desert, with almost no rain, but an average of 300 sunny days a year. There is nothing to complain about the lack of vitamin D here.\n\nI would like to thank all those who helped me and contributed to this path. To my family, friends, and academic staff at the University of Silesia, who instilled in me a curiosity for science.\n\nHow did it happen that I ended up in the USA? It was not an easy path - the story is described on my blog (link in the bio). Taking care of everything started in December last year.\n\nIf any of you is going to be in Reno area for the next 4 years, let me know, it'll be grat to see you ;)\n\n#studyintheusa\n#studyintheus\n#phdstudent #phdlife #science #scientist #microplastics #microplastic #desertresearchinstitute #universityofnevadareno #universityofnevada"}}]},"shortcode":"CTKbaurluIH","edge_media_to_comment":{"count":6},"taken_at_timestamp":1630250037,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240845730_929235907623376_7751348473333769091_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=glzz7FQEah0AX9ZxMRV\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8naXrLuiwzvwnqTbem__6O1EQblWBB0FAX_cL1n92Naw\u0026oe=62D19E01\u0026_nc_sid=4efc9f","edge_liked_by":{"count":107},"edge_media_preview_like":{"count":107},"owner":{"id":"9243396379"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240845730_929235907623376_77513484733337690